import React, { useState } from 'react'
import NutriDetailTable from './NutriDetailTable'
import NturiProducts from './NturiProducts'
import { useParams } from 'react-router'
import axios from 'axios'

const NutriDetail = () => {

    let {name} = useParams()

    useState(()=>{
        console.log('선택한 영양성분 :',  name);
        axios.get('http://localhost:8085/haru/nutridetail',
        {params :{
            name : `${name}`
        }})
        .then((res)=>{
            console.log('nutridetail 통신성공');
        })
        .catch((e)=>{
            console.log('error : ', e);
        })
    },[])

  return (
    <div>
        <NutriDetailTable nutriName={name}/>
        <NturiProducts nutriName={name}/>
    </div>
  )
}

export default NutriDetail
